function App() {
  return (
    // JavaScriptXml for more methods
    // Return: return one parent elem. So we use div there.
    <div>
      <h2>Hello World</h2>
      <p>We're a small group of volunteers that spend their free time maintaining this project, funded by the community. If Babel has benefited you in your work, becoming a contributor or sponsoring might just be a great way to give back!</p>
    </div>
  );
}

export default App;
